ट और लाभ और हानि खातों को विभिन्न खोज विकल्पों के साथ रिपोर्ट के रूप में उत्पन्न किया जा सकता है।';$lang['Admin and a normal user role available with default user role permissions. New users can be created for type of admin or normal user. When required additional user roles can be created with custom permissions and can be assigned to users. Complete language pack is available so that language translations can be added easily.'] = 'व्यवस्थापक और सामान्य उपयोगकर्ता भूमिका डिफ़ॉल्ट उपयोगकर्ता भूमिका अनुमतियों के साथ उपलब्ध है। नए उपयोगकर्ता प्रकार या सामान्य उपयोगकर्ता के लिए बनाए जा सकते हैं। जब आवश्यक अतिरिक्त उपयोगकर्ता भूमिकाएँ कस्टम अनुमतियों के साथ बनाई जा सकती हैं और उन्हें उपयोगकर्ताओं को सौंपा जा सकता है। पूरा भाषा पैक उपलब्ध है ताकि भाषा अनुवाद आसानी से जोड़े जा सकें।';$lang['vehicle'] = 'vehicle';$lang['vehicle_code'] = 'vehicle_code';$lang['vehicle_number'] = 'vehicle_number';$lang['owner_type'] = 'owner_type';$lang['supplier'] = 'supplier';$lang['delivery_route_name'] = 'delivery_route_name';$lang['delivery route'] = 'delivery route';$lang['Delivery Route'] = 'Delivery Route';$lang['sales_terminal_code'] = 'sales_terminal_code';$lang['sales_terminal_name'] = 'sales_terminal_name';$lang['Sales Terminal'] = 'Sales Terminal';$lang['sales terminal'] = 'sales terminal';$lang['cash unit'] = 'cash unit';$lang['cash_unit_name'] = 'cash_unit_name';$lang['cash_value_index'] = 'cash_value_index';$lang['category_name'] = 'category_name';$lang['unit_name'] = 'unit_name';$lang['unit_conversion_name'] = 'unit_conversion_name';$lang['from_amount_not_valid'] = 'from_amount_not_valid';$lang['to_amount_not_valid'] = 'to_amount_not_valid';$lang['from_unit_required'] = 'from_unit_required';$lang['to_unit_required'] = 'to_unit_required';$lang['from_amount'] = 'from_amount';$lang['to_amount'] = 'to_amount';$lang['unit conversion'] = 'unit conversion';$lang['unit_conversion_already_in_use_cannot_modify'] = 'unit_conversion_already_in_use_cannot_modify';$lang['tax_name'] = 'tax_